(798, 146, 'section_1_paragraph', 'We question. We challenge. We take a walk around the issue to look at it from every side. We avoid the expected. Take nothing for granted. And encourage our clients to come along for the ride. Because open minds create the space for bigger ideas, bolder thinking, approaches you never would have dreamed of, but wonder now how you ever did without.\r\n\r\nWe do this because we want to give our clients the very best of our thinking. To stretch and push and to never be satisfied with good enough.'),
