(2074, 212, 'section_2_paragraphs_0_paragraph_header', 'Empathy'),
(2075, 212, '_section_2_paragraphs_0_paragraph_header', 'field_55e75e2582567'),
(2076, 212, 'section_2_paragraphs_0_paragraph_copy', 'Its not a battle of wills. Or us vs. them. We always  always  appreciate what our clients are going through. Empathizing with their challenges, putting ourselves in their shoes and understanding what keeps them up at night. We like it when they can sleep well. '),
(2077, 212, '_section_2_paragraphs_0_paragraph_copy', 'field_55e75e3082568'),
(2078, 212, 'section_2_paragraphs_1_paragraph_header', 'Curiosity'),
(2079, 212, '_section_2_paragraphs_1_paragraph_header', 'field_55e75e2582567'),
(2080, 212, 'section_2_paragraphs_1_paragraph_copy', 'We believe in having the courage to let go of the reins. To challenge our own expectations and those of our clients. To push ideas farther than we imagined they could possibly go. Because thats where you find inspired answers. '),
(2081, 212, '_section_2_paragraphs_1_paragraph_copy', 'field_55e75e3082568'),
(2082, 212, 'section_2_paragraphs_2_paragraph_header', 'Honesty'),
(2083, 212, '_section_2_paragraphs_2_paragraph_header', 'field_55e75e2582567'),
(2084, 212, 'section_2_paragraphs_2_paragraph_copy', 'When youre true to your values, you can stand behind your work with absolute conviction. When you open the lines of communication with your clients, you create trusted relationships. When youre honest with yourself, youre never satisfied until you get it right.'),
(2085, 212, '_section_2_paragraphs_2_paragraph_copy', 'field_55e75e3082568'),
