(2114, 213, 'header_copy', 'We stand for open minds.'),
(2115, 213, '_header_copy', 'field_55e75ddd82561'),
(2116, 213, 'section_1_h2', 'We question.      We challenge.'),
(2117, 213, '_section_1_h2', 'field_55e75deb82562'),
(2118, 213, 'section_1_p', 'We take a walk around the issue to look at it from every side. We avoid the expected. Take nothing for granted. And encourage our clients to come along for the ride. Because open minds create the space for bigger ideas, bolder thinking, approaches you never would have dreamed of, but wonder now how you ever did without.\r\n\r\nWe do this because we want to give our clients the very best of our thinking. To stretch and push and to never be satisfied with good enough. Because we love what we do, and we want our clients to share that same passion, to get the same buzz we get when we know weve created something amazing together.'),
(2119, 213, '_section_1_p', 'field_55e75dfc82563'),
(2120, 213, 'section_2_h2', 'We always  always  appreciate what our clients  are going through.'),
